var $bm_rt;
var freq, amp, decay, n, n, t, t, v;
freq = 2;
amp = 50;
decay = 2;
$bm_rt = n = 0;
if (numKeys > 0) {
    $bm_rt = n = nearestKey(time).index;
    if (key(n).time > time) {
        n--;
    }
}
if (n == 0) {
    $bm_rt = t = 0;
} else {
    $bm_rt = t = $bm_sub(time, key(n).time);
}
if (n > 0) {
    v = velocityAtTime($bm_sub(key(n).time, $bm_div(thisComp.frameDuration, 10)));
    $bm_rt = $bm_sum(value, [
        0,
        amp * Math.sin(freq * t * 2 * Math.PI) / Math.exp(decay * t)
    ]);
} else {
    $bm_rt = value;
}

